script: |
  super -f text -I q4596.spq | sort > q4596.out

inputs:
  - name: q4596.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 IN ( - col0, CAST ( + ( + + 90 ) AS INTEGER ), + + col2 / ( col0 ) / 44 + + - col0 - col2 * + 94 );
  - name: tab2

outputs:
  - name: q4596.out
    data: |
      46	51	23
      64	77	40
      75	67	58
